irección de correo anabel(arroba)consultorioyorientacionpsicologica.es.</p>\n\n<p> Introduzca el codigo<br />[captchac captcha-774 size:m]   [captchar captcha-774]</p>\n\n<p>[submit \"Enviar\"]</p>'),(84,32,'_mail','a:7:{s:7:\"subject\";s:14:\"[your-subject]\";s:6:\"sender\";s:26:\"[your-name] <[your-email]>\";s:4:\"body\";s:192:\"De: [your-name] <[your-email]>\nAsunto: [your-subject]\n\nCuerpo del mensaje:\n[your-message]\n\n--\nEste e-mail se ha enviado vía formulario de consulta desde consultorioyorientacionpsicologica.es.\";s:9:\"recipient\";s:47:\"consultas@consultorioyorientacionpsicologica.es\";s:18:\"additional_headers\";s:0:\"\";s:11:\"attachments\";s:0:\"\";s:8:\"use_html\";b:0;}'),(85,32,'_mail_2','a:8:{s:6:\"active\";b:0;s:7:\"subject\";s:14:\"[your-subject]\";s:6:\"sender\";s:26:\"[your-name] <[your-email]>\";s:4:\"body\";s:140:\"Cuerpo del mensaje:\n[your-message]\n\n--\nEste e-mail se ha enviado vía formulario de contacto desde Anabel Blog http://192.168.1.30/wordpress\";s:9:\"recipient\";s:12:\"[your-email]\";s:18:\"additional_headers\";s:0:\"\";s:11:\"attachments\";s:0:\"\";s:8:\"use_html\";b:0;}'),(86,32,'_messages','a:21:{s:12:\"mail_sent_ok\";s:52:\"Su mensaje se ha enviado con éxito. Muchas gracias.\";s:12:\"mail_sent_ng\";s:110:\"Falló el envío del mensaje. Por favor, inténtelo más tarde o contacte con el administrador por otro medio.\";s:16:\"validation_error\";s:97:\"Ocurrió un error de validación. Por favor, confirme los campos y envíe el formulario de nuevo.\";s:4:\"spam\";s:110:\"Falló el envío del mensaje. Por favor, inténtelo más tarde o contacte con el administrador por otro medio.\";s:12:\"accept_terms\";s:61:\"Por favor, acepte los términos y condiciones para continuar.\";s:16:\"invalid_required\";s:39:\"Por favor, complete el campo requerido.\";s:17:\"captcha_not_match\";s:35:\"El código ingresado es incorrecto.\";s:12:\"invalid_date\";s:37:\"El formato de fecha parece inválido.\";s:14:\"date_too_early\";s:25:\"Fecha demasiado tempra